import React, { useEffect, useState } from 'react';

function App() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetch('http://localhost:3000/')
      .then(res => res.text())
      .then(setMessage)
      .catch(console.Error); // Add this to log errors
  }, []);

  return (
    <div>
      <h1>Backend API Test</h1>
      <p>{message}</p>
    </div>
  );
}

export default App;
